import NavComponent from "../components/NavComponent";
import PersonajeComponent from "../components/PersonajeComponent";


const PersonajeContainer = () => {
  


  return (
    <div className="container">
      <NavComponent />
     
      <div clasName="row">

  
            <PersonajeComponent/>

 
          

      </div>
    </div>
  )
}
export default PersonajeContainer;
